use keccak256::keccak256;

global MAX_SIGNERS: u32 = 3;

pub fn main(
    message_hash: [u8; 32], 
    operation_signature: [u8; 65],
    identity_verification_signature: [u8; 65],
    identity_pub_x: [u8; 32],
    identity_pub_y: [u8; 32],
    operation_pub_x: [u8; 32],
    operation_pub_y: [u8; 32],
    signers_identifiers: [u8; 32 * MAX_SIGNERS],
    threshold: u32, 
    contract_address: [u8; 20]
) -> pub (Field, Field, Field, Field) {
    // --------------------IDENTITY VERIFICATION-------------------- // 
    // verify the identity signature is valid
    let identity_verification_signature_message_hash = keccak256(
        bytes_to_hex_string(contract_address),
        40
    );

    let mut identity_sig_64: [u8; 64] = [0; 64];
    for i in 0..64 {
        identity_sig_64[i] = identity_verification_signature[i];
    }

    assert(std::ecdsa_secp256k1::verify_signature(
        identity_pub_x,
        identity_pub_y, 
        identity_sig_64, 
        identity_verification_signature_message_hash
    ));


    let hashed_verification_signature = keccak256(signature_to_hex_string(identity_verification_signature), 130);

    let mut is_valid = false;
    for i in 0..MAX_SIGNERS {
        if i < threshold {
            let start_idx = i * 32;
            let mut matches = true;
            for j in 0..32 {
                if hashed_verification_signature[j] != signers_identifiers[start_idx + j] {
                    matches = false;
                }
            }
            if matches {
                is_valid = true;
            }
        }
    }
    assert(is_valid, "Verification signature does not match any authorized signer");

    // --------------------PAYLOAD SIGNATURE VERIFICATION-------------------- // 

    let mut operation_sig_64: [u8; 64] = [0; 64];
    for i in 0..64 {
        operation_sig_64[i] = operation_signature[i];
    }

    assert(std::ecdsa_secp256k1::verify_signature(operation_pub_x, operation_pub_y, operation_sig_64, message_hash));

    let signer_identifiers_hash = hash_signer_identifiers(signers_identifiers, 3);

    let message_hash_field_31_bytes = field_from_bytes_32_trunc(message_hash);
    let signer_identifiers_hash_field_31_bytes = field_from_bytes_32_trunc(signer_identifiers_hash);

    // Concatenate last bytes of both hashes
    let message_hash_last_byte = message_hash[31] as Field;
    let signer_identifier_hash_last_byte = signer_identifiers_hash[31] as Field;
    // Multiply by 256 to shift left by 8 bits (equivalent to << 8)
    let last_bytes_field = (message_hash_last_byte * 256) + signer_identifier_hash_last_byte;
    (address_to_field(contract_address),  message_hash_field_31_bytes, signer_identifiers_hash_field_31_bytes,  last_bytes_field)
}



fn field_from_bytes_32_trunc(bytes32: [u8; 32]) -> Field {
    // Convert it to a field element
    let mut v = 1;
    let mut high = 0 as Field;
    let mut low = 0 as Field;

    for i in 0..15 {
        // covers bytes 16..30 (31 is truncated and ignored)
        low = low + (bytes32[15 + 15 - i] as Field) * v;
        v = v * 256;
        // covers bytes 0..14
        high = high + (bytes32[14 - i] as Field) * v;
    }
    // covers byte 15
    low = low + (bytes32[15] as Field) * v;

    low + high * v
}




fn bytes_to_field(bytes: [u8; 32]) -> Field {
    let mut result: Field = 0;

    // Convert bytes to field
    for i in 0..32 {
        result = result * 256 + (bytes[i] as Field);
    }

    result
}


fn address_to_field(bytes: [u8; 20]) -> Field {
    let mut result: Field = 0;

    // Convert bytes to field
    for i in 0..20 {
        result = result * 256 + (bytes[i] as Field);
    }

    result
}

fn nibble_to_ascii(nibble: u8) -> u8 {
    if nibble < 10 {
        nibble + 48  // '0' to '9'
    } else {
        nibble + 87  // 'a' to 'f'
    }
}

// Function to convert hex bytes to ASCII string representation
fn signature_bytes_to_ascii(hex_bytes: [u8; 65]) -> [u8; 132] {
    let mut result: [u8; 132] = [0; 132];

    // Add "0x" prefix
    result[0] = 48;  // '0'
    result[1] = 120; // 'x'

    // Convert each byte to two ASCII characters
    for i in 0..65 {
        let byte = hex_bytes[i];
        let high_nibble = byte >> 4;
        let low_nibble = byte & 0x0f;

        result[2 + i * 2] = nibble_to_ascii(high_nibble);
        result[2 + i * 2 + 1] = nibble_to_ascii(low_nibble);
    }

    result
}

fn address_bytes_to_ascii(address_bytes: [u8; 20]) -> [u8; 42] {
    let mut result: [u8; 42] = [0; 42]; // 0x + 40 hex chars

    // Add "0x" prefix
    result[0] = 48;  // '0'
    result[1] = 120; // 'x'

    // Convert each byte to two ASCII characters
    for i in 0..20 {
        let byte = address_bytes[i];
        let high_nibble = byte >> 4;
        let low_nibble = byte & 0x0f;

        // Convert high nibble to hex
        result[2 + i * 2] = if high_nibble < 10 {
            high_nibble + 48 // '0' to '9'
        } else {
            high_nibble + 87 // 'a' to 'f'
        };

        // Convert low nibble to hex
        result[2 + i * 2 + 1] = if low_nibble < 10 {
            low_nibble + 48 // '0' to '9'
        } else {
            low_nibble + 87 // 'a' to 'f'
        };
    }

    result
}

fn create_ethereum_signed_message_hash(message: [u8], message_len: u32) -> [u8; 32] {
    // Create the Ethereum Signed Message prefix
    let prefix: [u8; 26] = [
        25, 69, 116, 104, 101, 114, 101, 117, 109, 32, 83, 105, 103, 110, 101, 100, 32, 77, 101, 115, 115, 97, 103, 101, 58, 10
    ];

    // Convert message length to ASCII string
    let mut length_str: [u8; 2] = [0; 2];
    let tens = message_len / 10;
    let ones = message_len % 10;
    length_str[0] = 48 + tens as u8; // Convert to ASCII
    length_str[1] = 48 + ones as u8; // Convert to ASCII

    // Calculate total length
    let total_len = 26 + 2 + message_len as u32;
    let mut full_message: [u8; 100] = [0; 100]; // Using a larger buffer to be safe

